pragma solidity ^0.8.9;

import "./structs.sol";
import "hardhat/console.sol";

error user__not__exist();
error Not_Allowed();
error out_of_time();
error already_voted();
error not_ended();
error Not_Found();
error No_Election_yet();
error Condidate_Not_Exist();
error Not_Voted_Yet();

contract Election {
    /*tyoe declaration */

    enum ElectionState {
        CLOSE,
        OPEN
    }

    /*election variable */
    ElectionState private s_ellectionState;
    uint256 private s_timeStamp;
    uint216 private s_interval;
    uint256 private s_lastTimeStamp;
    address private immutable i_owner;
    address[] private s_admins;
    uint256 private s_lastCondidateId;
    uint256 private s_electionId;
    string[] private s_numOfCondidates;
    mapping(address => Structs.User) private users;
    mapping(string => Structs.Candidate) private candidate;
    mapping(uint256 => Structs.Elction) private election;
    mapping(uint256 => Structs.Results) private result;

    /* modefiers */

    modifier onlyOwner() {
        if (msg.sender != i_owner) {
            revert Not_Allowed();
        }
        _;
    }

    modifier onlyAdmins() {
        for (uint256 i = 0; i < s_admins.length; i++) {
            if (msg.sender == s_admins[i]) {
                _;
            }
        }
    }

    /*constructor */

    constructor() {
        s_ellectionState = ElectionState.CLOSE;
        i_owner = msg.sender;
        s_admins.push(i_owner);
        s_electionId = 0;
        initializeCondidates();
        addElection(60, ["Elon", "Jeff", "", ""], "h", "b");
    }

    /*functions */

    function addAdmin(address addr) public onlyOwner {
        s_admins.push(addr);
    }

    function addCondidate(
        string memory condidateName,
        string memory description,
        string memory party
    ) public onlyAdmins {
        candidate[condidateName].condidateName = condidateName;
        candidate[condidateName].description = description;
        candidate[condidateName].party = party;
        candidate[condidateName].nominationNumber = 0;
        candidate[condidateName].numberOfWins = 0;
        s_numOfCondidates.push(condidateName);
    }

    function addElection(
        uint256 interval,
        string[4] memory condidates,
        string memory title,
        string memory description
    ) public onlyAdmins {
        s_electionId += 1;
        election[s_electionId].electionId = s_electionId;
        election[s_electionId].title = title;
        election[s_electionId].interval = interval;
        election[s_electionId].description = description;
        election[s_electionId].isClose = 0;
        for (uint256 i = 0; i < condidates.length; i++) {
            if (keccak256(abi.encode(condidates[i])) == "") break;
            election[s_electionId].condidateNames.push(condidates[i]);
        }

        for (uint256 i = 0; i < election[s_electionId].condidateNames.length; i++) {
            election[s_electionId].votes[election[s_electionId].condidateNames[i]].numOfVotes = 0;
        }

        s_ellectionState = ElectionState.OPEN;

        s_lastTimeStamp = block.timestamp;

        // console.log("election[s_electionId].interval", election[s_electionId].interval);
        // console.log("\nblock.timestamp", block.timestamp, "\ns_lastTimeStamp", s_lastTimeStamp);
    }

    function vote(address voter, uint256 electionId, string memory candidateName) public {
        if (
            (s_ellectionState == ElectionState.OPEN) &&
            ((block.timestamp - s_lastTimeStamp) > election[s_electionId].interval)
        ) {
            if (!users[voter].isValid) {
                users[voter].isValid = true;
                users[voter].id = voter;
                election[electionId].votes[candidateName].numOfVotes += 1;
            }

            if (!users[voter].votes[electionId].isVoted) {
                users[voter].votes[electionId].electionId = electionId;
                users[voter].votes[electionId].candidateName = candidateName;
            } else revert already_voted();
        } else revert out_of_time();
    }

    function setResult(uint256 electionId) public onlyAdmins {
        if (
            (block.timestamp - s_lastTimeStamp > election[s_electionId].interval) &&
            (s_ellectionState == ElectionState.OPEN)
        ) {
            s_lastTimeStamp = 0;
            s_ellectionState = ElectionState.CLOSE;
            uint256 numOfVotes = 0;
            for (uint256 i = 0; i < election[electionId].condidateNames.length; i++) {
                if (
                    election[electionId].votes[election[electionId].condidateNames[i]].numOfVotes >
                    numOfVotes
                ) {
                    result[electionId].electionId = electionId;
                    result[electionId].condidateName = election[electionId].condidateNames[i];
                    result[electionId].voteCount = election[electionId]
                        .votes[election[electionId].condidateNames[i]]
                        .numOfVotes;
                    numOfVotes = election[electionId]
                        .votes[election[electionId].condidateNames[i]]
                        .numOfVotes;
                }
            }
        } else revert not_ended();
    }

    /** Getter Functions */

    function getOwner() public view returns (address) {
        return i_owner;
    }

    function getAdmins() public view returns (address[] memory) {
        return s_admins;
    }

    function getElectionById(
        uint256 electionId
    ) public view returns (string memory, uint256, string memory, string[] memory) {
        if (election[electionId].electionId == electionId) {
            uint256 remainingTime = block.timestamp - s_lastTimeStamp;
            return (
                election[electionId].title,
                remainingTime,
                election[electionId].description,
                election[electionId].condidateNames
            );
        } else revert Not_Found();
    }

    function getElectionsCount() public view returns (uint256) {
        console.log("s_electionId");
        console.log(s_electionId);
        return s_electionId;
    }

    function getCurrentElectionState() public view returns (uint256) {
        if (block.timestamp - s_lastTimeStamp < election[s_electionId].interval) {
            console.log("election[s_electionId].interval", election[s_electionId].interval);
            console.log("\nblock.timestamp", block.timestamp, "\ns_lastTimeStamp", s_lastTimeStamp);
            return 1;
        }
        console.log("nop its wrong");
        return 0;
    }

    function isUserExist(address addr) public view returns (bool) {
        return users[addr].isValid;
    }

    function getUserHistory(address addr) public view returns (Structs.UserVotes[] memory) {
        uint256 voteCounter;
        if (users[addr].isValid) {
            for (uint256 i = 0; i < s_electionId; i++) {
                if (users[addr].votes[i].isVoted) {
                    voteCounter += 1;
                }
            }
            Structs.UserVotes[] memory history = new Structs.UserVotes[](voteCounter);

            for (uint256 i = 0; i < voteCounter; i++) {
                history[i] = users[addr].votes[i];
            }
            return history;
        }
    }

    function getCondidate(string memory name) public view returns (Structs.Candidate memory) {
        if (keccak256(abi.encode(candidate[name].condidateName)) == keccak256(abi.encode(name))) {
            return candidate[name];
        } else revert Condidate_Not_Exist();
    }

    function getResults() public view returns (Structs.Results[] memory) {
        if (s_electionId != 0) {
            uint256 numOfResult = s_electionId;
            if (s_ellectionState == ElectionState.OPEN) {
                numOfResult -= 1;
            }
            Structs.Results[] memory results = new Structs.Results[](numOfResult);
            for (uint256 i = 0; i < numOfResult; i++) {
                results[i] = result[i];
            }
            return results;
        } else revert No_Election_yet();
    }

    function getResultById(uint256 electionId) public view returns (Structs.Results memory) {
        return result[electionId];
    }

    function getReminingTime() public view returns (uint256) {
        return election[s_electionId].interval - (block.timestamp - s_lastTimeStamp);
    }

    // primery data

    function initializeCondidates() public {
        addCondidate(
            "Satya",
            "Satya Narayana Nadella is an Indian-American business executive. He is the executive chairman and CEO of Microsoft, succeeding Steve Ballmer in 2014 as CEO and John W. Thompson in 2021 as chairman.",
            "microsoft"
        );
        addCondidate(
            "Jeff",
            "Jeffrey Preston Bezos is an American entrepreneur, media proprietor, investor, and commercial astronaut. He is the founder, executive chairman, and former president and CEO of Amazon",
            "Amazon"
        );
        addCondidate(
            "Elon",
            "Elon Reeve Musk FRS is a business magnate and investor. He is the founder, CEO and chief engineer of SpaceX; angel investor, CEO and product architect of Tesla, Inc.; owner and CEO of Twitter, Inc.; founder of The Boring Company; co-founder of Neuralink and OpenAI; and president of the philanthropic Musk Foundation",
            "SpaceX"
        );
        addCondidate(
            "Mark",
            "Mark Elliot Zuckerberg is an American business magnate, internet entrepreneur, and philanthropist. He is known for co-founding the social media website Facebook and its parent company Meta Platforms, of which he is the chairman, chief executive officer, and controlling shareholder",
            "meta"
        );
        addCondidate(
            "Pavel",
            "Pavel Valeryevich Durov is a Russian-born French-Emirati entrepreneur who is known for being the founder of the social networking site VK and Telegram Messenger. He is the younger brother of Nikolai Durov.",
            "telegram"
        );
        console.log(block.timestamp);
    }
}
