pragma solidity ^0.8.9;

/**
 *       @author moah
 */

library Structs {
    struct User {
        address id;
        bool isValid;
        mapping(uint256 => UserVotes) votes;
    }

    struct UserVotes {
        uint electionId;
        string candidateName;
        bool isVoted;
    }

    struct Candidate {
        string condidateName;
        string description;
        string party;
        uint256 nominationNumber;
        uint256 numberOfWins;
    }

    struct Elction {
        uint256 electionId;
        string title;
        uint256 interval;
        string description;
        uint256 isClose;
        string[] condidateNames;
        mapping(string => CondidateVote) votes;
    }

    struct CondidateVote {
        uint256 numOfVotes;
    }

    struct Results {
        uint256 electionId;
        string condidateName;
        uint256 voteCount;
    }
}
